webpackJsonp([5368439509062],{414:function(a,n){a.exports={data:{markdownRemark:{html:'<p><strong>WARNING: POS INI TIDAK ADA MEMENYA</strong></p>\n<p>Beberapa hari lalu, diadakan Try Out PJJ OSN Komputer yang terdiri dari 4 soal. Sayangnya, selain tidak semua peserta mengikuti try out tersebut, ada juga peserta yang mendapat nilai 0 pada suatu soal. Hal ini memancing saya membuat pos tentang nyampah, yang mungkin sering dianggap sepele, namun dapat berdampak besar. Nyampah sendiri adalah istilah yang sering saya gunakan yang berarti berusaha mendapatkan poin, walaupun sedikit, pada suatu soal. Mungkin karena tidak sekeren mendapatkan AC, banyak peserta yang tidak memikirkan strategi ini. Selain itu, strategi ini juga sulit dilatih jika tidak mengerjakan soal-soal OSN yang sudah usai. Jika kamu hanya berlatih pada kelas pembelajaran TLX dan pelatdamu menggunakan VJudge yang biasanya tidak menggunakan subtask, post ini adalah post yang tepat untukmu! </p>\n<h3>Motivasi</h3>\n<p>Saya pertama kali “didoktrin” nyampah oleh Indra. Sebagai veteran OSN 2015, dia menceritakan pengalamannya pada hari 1 yang buruk sehingga tidak masuk zona medali. Pada hari 2, Dia memasuki mode “nothing to lose” dan akhirnya fokus untuk nyampah dan karena itu, Dia berhasil membawa pulang medali perunggu. Ceritanya mungkin sepele namun Dia selalu menceritakannya baik saat pelatda maupun di Palembang (saat OSN) sehingga ceritanya meresap ke kalbu saya <img class="emoji-icon" data-icon="emoji-joy" style="display: inline; margin: 0; margin-top: 1px; position: relative; width: 20px" src="data:image/png;base64, ">. Jika nyampah pada satu hari dapat membuatmu mendapat perunggu, bagaimana jika dua hari? Ada pandangan unik yang cukup umum dalam OSN Komputer yaitu “Lo nyampah aja di komputer bisa dapet perak”. Mungkin ini menjawab pentingnya nyampah dalam OSN.</p>\n<p>Saya juga pernah mengajar pada suatu pelatda. Sayangnya, ada salah satu peserta yang belum bisa ngoding. Seingat saya, hanya tersisa dua minggu sebelum OSN dilaksanakan dan saat itu Dia bahkan belum mengerti for loop. Walau begitu, sepertinya Dia hebat dalam matematika sehingga tidak heran dapat lolos OSP. Hebatnya, Dia mendapat peringkat 40-an ketika scoreboard di-freeze, mengalahkan peserta yang bisa ngoding! Ternyata, Dia berhasil mendapat beberapa poin pada <strong>semua soal</strong>. Saya rasa, Dia berhasil menjawab semua open subtask dengan “menguli” di kertas. Semangatnya dalam memaksimalkan apa yang Dia bisa mengajarkan kita satu hal. <strong>Jangan pernah meninggalkan soal tanpa mendapat poin</strong>. Oh iya, soal open subtask memang dirancang sedemikian hingga dapat dijawab dengan menghitung manual di kertas dan setahu saya selalu ada open subtask dalam setiap soal. Sayangnya, tetap saja banyak peserta yang sama sekali tidak mendapat poin di suatu soal.</p>\n<p>Selain keuntungan dari perhitungan poin secara matematis, ada keuntungan lain yang didapat dari nyampah. Menurutmu, apa alasan beberapa peserta sama sekali tidak mendapat poin pada suatu soal? Bayangkan kamu sedang menjalani OSN, duduk di depan komputer. Kamu mencoba menjawab soal-soal yang ada, namun entah mengapa terasa sangat sulit. Waktu pun berjalan menit demi menit, hingga tak terasa OSN telah berlangsung selama 3 jam. Kamu yang belum mendapat poin secara sadar maupun tidak mulai kehilangan kepercayaan diri, hingga akhirnya kontes berakhir dengan penyesalan. Jika takdir dapat diubah, bayangkan jika pada 3 jam pertama kamu sudah mendapat cukup banyak poin. Berdasarkan pengalaman, nyampah (apalagi AC <img class="emoji-icon" data-icon="emoji-wink" style="display: inline; margin: 0; margin-top: 1px; position: relative; width: 20px" src="data:image/png;base64, ">) dapat membangkitkan semangatmu sehingga menjadi katalis yang mendatangkan banyak poin selanjutnya. Berdasarkan pengalaman saya, tidak mendapat poin pada 3 jam pertama (atau bahkan 2) merupakan hal fatal yang berpotensi menghancurkan performamu hingga akhir, termasuk selesai dengan poin 0 yang jika kamu bayangkan sekarang mungkin agak aneh mengingat 5 jam waktu yang cukup banyak. Hal ini cukup menarik dan disebut Kak Wilgoz sebagai “moral” yang dapat dibaca <a href="http://kupaskode.blogspot.com/2018/06/strategi-kontes-icpc.html">di sini</a>.</p>\n<h3>Preview</h3>\n<p>Pada pos mengenai nyampah ini, saya akan membahas 2 teknik yaitu brute force semua kemungkinan dan random. Brute force semua kemungkinan biasanya dapat digunakan untuk mendapatkan subtask 1 (open subtask) dan 3 (N &#x3C;= 20) sedangkan random dapat digunakan untuk medapatkan poin pada soal output only. Dengan teknik ini, setidaknya total 50 poin seharusnya sudah ada di tangan. Apa hanya ini cara nyampah? Tentu tidak namun saya rasa sisanya bervariasi tergantung soal, sedangkan 2 teknik ini “dijamin” mendatangkan keuntungan jika kamu tidak tahu apa-apa. Agar tidak terlalu panjang, pos tentang random akan saya pisah sehingga pada pos ini hanya membahas tentang brute force. Saya tahu ini materi yang sangat dasar sehingga silakan tutup jika kamu sudah mengetahuinya <img class="emoji-icon" data-icon="emoji-wink" style="display: inline; margin: 0; margin-top: 1px; position: relative; width: 20px" src="data:image/png;base64, ">.</p>\n<h3>Brute Force</h3>\n<p>Ada 2 teknik yang akan saya bahas, keduanya memiliki kompleksitas eksponensial <span class="katex"><span class="katex-mathml"><math><semantics><mrow><mi>O</mi><mo>(</mo><msup><mi>a</mi><mi>N</mi></msup><mo>)</mo></mrow><annotation encoding="application/x-tex">O(a^N)</annotation></semantics></math></span><span class="katex-html" aria-hidden="true"><span class="strut" style="height:0.8413309999999999em;"></span><span class="strut bottom" style="height:1.0913309999999998em;vertical-align:-0.25em;"></span><span class="base"><span class="mord mathit" style="margin-right:0.02778em;">O</span><span class="mopen">(</span><span class="mord"><span class="mord mathit">a</span><span class="msupsub"><span class="vlist-t"><span class="vlist-r"><span class="vlist" style="height:0.8413309999999999em;"><span style="top:-3.063em;margin-right:0.05em;"><span class="pstrut" style="height:2.7em;"></span><span class="sizing reset-size6 size3 mtight"><span class="mord mathit mtight" style="margin-right:0.10903em;">N</span></span></span></span></span></span></span></span><span class="mclose">)</span></span></span></span> dan sepertinya interchangeable. Walau begitu, cara kedua sedikit lebih sulit jika kamu belum mengenal bitmask walaupun menurut saya cara kedua lebih mudah jika telah mengenal bitmask. Sebagai topik bahasan, saya akan menggunakan soal TLX yaitu <a href="https://training.ia-toki.org/training/curriculums/1/courses/11/chapters/52/problems/230/">Grup Piala Dunia</a>.</p>\n<h3>Penutup</h3>\n<p>Dengan teknik brute force ini, diharapkan kamu tidak mendapat poin 0 pada soal <strong>apa pun</strong>. Perlu diperhatikan bahwa ini adalah teknik yang sangat dasar, <strong>jangan langsung berpikir untuk mengerjakan dengan cara ini tanpa mencoba beripikir cara lain terlebih dahulu</strong>. Ada beberapa soal yang sangat mudah disampah menggunakan for loop dan bahkan mendapat 50+ poin sehingga sangat disayangkan jika kamu mengerjakannya dengan brute force ini. Sampai jumpa pada pos berikutnya!</p>',frontmatter:{title:"Teknik Nyampah OSN Komputer - Brute Force",date:"13 June 2018",description:"Cara mengais poin pada OSN Komputer yang penting namun jarang dibahas."},fields:{slug:"/teknik-nyampah-brute-force/"}}},pathContext:{slug:"/teknik-nyampah-brute-force/"}}}});
//# sourceMappingURL=path---blog-teknik-nyampah-brute-force-08636354efd03b199ba8.js.map